    var raster = new ol.layer.Tile({
        title: 'Open Street Map',
        source: new ol.source.OSM(),
        type: 'base',

    });


    var vectorL=new ol.layer.Vector({
        source:new ol.source.Vector({
            format:new ol.format.GeoJSON({featureProjection:'EPSG:3857'}),
            url:"pov.geojson",

}),
        style:styleFunction
    });


    var vectorL2=new ol.layer.Vector({
        source:new ol.source.Vector({
            format:new ol.format.GeoJSON({featureProjection:'EPSG:3857'}),
            url:"loc.geojson",

        }),
        style:styleFunction
    });

    /*var provinces = new ol.layer.Tile({

        source: new ol.source.TileWMS({

            url: 'http://localhost:8080/geoserver/cite/wms',

            params: {

                'LAYERS': 'provinces_maroc',

                'TRANSPARENT': 'true',

                'WIDTH': 640,

                'HEIGHT': 480
            },
            projection: 'EPSG:3857'
        })
    });*/

    var olCoordinates = ol.proj.fromLonLat([-8, 32]);
    var map = new ol.Map({
        target: 'map',
        layers:[raster,vectorL,vectorL2],

        controls: ol.control.defaults({
            attributionOptions: /** @type {olx.control.AttributionOptions} */ ({
                collapsible: false
            })
        }),
        view: new ol.View({
            center:olCoordinates,
            zoom: 5
        })
    });

    var dims = {
        a0: [1189, 841],
        a1: [841, 594],
        a2: [594, 420],
        a3: [420, 297],
        a4: [297, 210],
        a5: [210, 148]
    };

    var loading = 0;
    var loaded = 0;

    var exportButton = document.getElementById('export-pdf');

    exportButton.addEventListener('click', function() {

        exportButton.disabled = true;
        document.body.style.cursor = 'progress';

        var format = document.getElementById('format').value;
        var resolution = document.getElementById('resolution').value;
        var dim = dims[format];
        var width = Math.round(dim[0] * resolution / 25.4);
        var height = Math.round(dim[1] * resolution / 25.4);
        var size = /** @type {ol.Size} */ (map.getSize());
        var extent = map.getView().calculateExtent(size);

        var source = raster.getSource();

        var tileLoadStart = function() {
            ++loading;
        };

        var tileLoadEnd = function() {
            ++loaded;
            if (loading === loaded) {
                var canvas = this;
                window.setTimeout(function() {
                    loading = 0;
                    loaded = 0;
                    var data = canvas.toDataURL('image/png');
                    var pdf = new jsPDF('landscape', undefined, format);
                    pdf.addImage(data, 'JPEG', 0, 0, dim[0], dim[1]);
                    pdf.save('map.pdf');
                    source.un('tileloadstart', tileLoadStart);
                    source.un('tileloadend', tileLoadEnd, canvas);
                    source.un('tileloaderror', tileLoadEnd, canvas);
                    map.setSize(size);
                    map.getView().fit(extent, size);
                    map.renderSync();
                    exportButton.disabled = false;
                    document.body.style.cursor = 'auto';
                }, 100);
            }
        };

        map.once('postcompose', function(event) {
            source.on('tileloadstart', tileLoadStart);
            source.on('tileloadend', tileLoadEnd, event.context.canvas);
            source.on('tileloaderror', tileLoadEnd, event.context.canvas);
        });

        map.setSize([width, height]);
        map.getView().fit(extent, /** @type {ol.Size} */ (map.getSize()));
        map.renderSync();

    }, false);

    $('input[type=checkbox]').on('change', function () {
        var layer = {
            layer1: raster,
            layer2: vectorL,
            layer3: vectorL2,
        }[$(this).attr('id')];
        layer.setVisible(!layer.getVisible());
    });
    map.on('click', function(evt){
        var feature = map.forEachFeatureAtPixel(
            evt.pixel, function(ft, l) { return ft; }
        );

        if (feature) {
            //you can see all properties with getProperties()
            console.info(feature.getProperties());

            //and you can get directly a property
            console.info(feature.get('any-property'));
        }
    });
